	"sap/webanalytics/core/SAPWebAnalyticsFLPPlugin/i18n/i18n_id.properties":'\nAPP_TITLE=SAP Web Analytics - FLP Plug-In\n\nAPP_DESCRIPTION=Plug-in SAP Web Analytics untuk melacak SAP Fiori Launchpad\n\nCONSENT_OPT_IN_TEXT=Situs ini menggunakan SAP Web Analytics untuk menganalisis cara situs ini digunakan. Cookie digunakan untuk mengidentifikasi kunjungan berulang. Jika Anda setuju, tentukan preferensi Anda menggunakan opsi "Izinkan" di bawah. Informasi yang dihasilkan (termasuk bagian dari alamat IP Anda dan ID browser) akan dikirimkan ke dan disimpan oleh SAP di servernya. Kami akan menggunakan informasi ini hanya untuk tujuan mengevaluasi penggunaan situs web dan menyusun laporan tentang aktivitas situs web untuk operator situs web, serta untuk meningkatkan situs. Keputusan Anda adalah persetujuan Anda untuk memproses data analitik dengan cara dan untuk tujuan yang ditetapkan atas.\n\nCONSENT_OPT_OUT_TEXT=Situs ini menggunakan SAP Web Analytics untuk menganalisis cara pengguna menggunakan situs. Berdasarkan persetujuan Anda sebelumnya, cookie disimpan di browser perangkat Anda untuk mengidentifikasi kunjungan berulang Anda dan halaman asal kunjungan Anda. Informasi ini digunakan semata-mata untuk tujuan mengevaluasi penggunaan situs web dan untuk lebih meningkatkan situs. Jika Anda ingin mencabut persetujuan pelacakan Anda, harap tentukan preferensi Anda menggunakan tombol "Hentikan Pelacakan" di bawah.\nCONSENT_BUTTON_ALLOW=Izinkan\n\nCONSENT_BUTTON_DENY=Tolak\n\nCONSENT_BUTTON_STOP_TRACKING=Hentikan Pelacakan\n\nCONSENT_TOOLTIP_CLOSE=Tutup\n\nPRIVACY_LINK_TEXT=Tautan Privasi\n\nANONYMOUS_CONSENT_OPT_IN_TEXT=Situs ini menggunakan SAP Web Analytics untuk menganalisis cara situs ini digunakan. Cookie digunakan untuk mengidentifikasi kunjungan berulang. Jika Anda setuju, tentukan preferensi Anda menggunakan opsi "Izinkan" di bawah, jika tidak, pelacakan anonim akan berlanjut. Informasi yang dihasilkan (termasuk bagian dari alamat IP Anda dan ID browser) akan dikirimkan ke dan disimpan oleh SAP di servernya. Kami akan menggunakan informasi ini hanya untuk tujuan mengevaluasi penggunaan situs web dan menyusun laporan tentang aktivitas situs web untuk operator situs web - dan pada akhirnya, untuk meningkatkan situs. Keputusan Anda adalah persetujuan Anda untuk memproses data analitik dengan cara dan untuk tujuan yang ditetapkan atas.\nANONYMOUS_CONSENT_OPT_OUT_TEXT=Situs ini menggunakan SAP Web Analytics untuk menganalisis cara pengguna menggunakan situs. Berdasarkan persetujuan Anda sebelumnya, cookie disimpan di browser perangkat Anda untuk mengidentifikasi kunjungan berulang Anda. Informasi ini digunakan semata-mata untuk tujuan mengevaluasi penggunaan situs web dan untuk lebih meningkatkan situs. Jika Anda ingin menganonimkan pelacakan, harap tentukan preferensi Anda menggunakan tombol "Anonimkan" di bawah.\nANON_TRK_BUTTON_TEXT=Anonimkan\n\nCUSTOM_CONSENT_OPTION=SAP Web Analytics\nTRACKING_ON_STATUS=Diaktifkan\nTRACKING_OFF_STATUS=Dinonaktifkan\nTRACKING_ANON_STATUS=Pelacakan Anonim\nTRACKING_STATUS_TEXT=Status\\:\n\n',
	"sap/webanalytics/core/SAPWebAnalyticsFLPPlugin/i18n/i18n_it.properties":'\nAPP_TITLE=SAP Web Analytics - plug-in FLP\n\nAPP_DESCRIPTION=Plug-in SAP Web Analytics per tracciare SAP Fiori Launchpad\n\nCONSENT_OPT_IN_TEXT=Questo sito utilizza SAP Web Analytics per analizzare come viene utilizzato questo sito. I cookie vengono utilizzati per identificare le visite ripetute. Se sei d\'accordo, indica la tua preferenza con il pulsante "Consenti" in basso. Le informazioni generate (compresa una parte del tuo indirizzo IP e di un ID browser) saranno trasmesse a SAP e archiviate da SAP sui suoi server. Tali informazioni saranno utilizzate solo allo scopo di valutare l\'utilizzo del sito Web e compilare report sull\'attivit\\u00E0 del sito Web per gli operatori del sito Web e per migliorare il sito. Con l\'adesione, acconsenti al trattamento dei dati analitici nel modo e per gli scopi sopra indicati.\n\nCONSENT_OPT_OUT_TEXT=Questo sito utilizza SAP Web Analytics per analizzare come gli utenti utilizzano il sito. Sulla base del tuo consenso preventivo, nel browser del tuo dispositivo viene reso persistente un cookie per identificare le tue visite ripetute e la pagina di origine delle tue visite. Queste informazioni vengono utilizzate esclusivamente allo scopo di valutare l\'utilizzo del sito Web e per migliorare ulteriormente il sito. Per revocare il tuo consenso al tracciamento, indica le tue preferenze utilizzando il pulsante "Interrompi tracciamento" qui di seguito.\nCONSENT_BUTTON_ALLOW=Consenti\n\nCONSENT_BUTTON_DENY=Vieta\n\nCONSENT_BUTTON_STOP_TRACKING=Interrompi tracciamento\n\nCONSENT_TOOLTIP_CLOSE=Chiudi\n\nPRIVACY_LINK_TEXT=Link relativo alla protezione dei dati\n\nANONYMOUS_CONSENT_OPT_IN_TEXT=Questo sito utilizza SAP Web Analytics per analizzare come viene utilizzato questo sito. I cookie vengono utilizzati per identificare le visite ripetute. Se sei d\'accordo, indica la tua preferenza con il pulsante "Consenti" in basso, altrimenti continuer\\u00E0 il tracciamento anonimo. Le informazioni generate (compresa una parte del tuo indirizzo IP e di un ID browser) saranno trasmesse a SAP e archiviate da SAP sui suoi server. Tali informazioni saranno utilizzate solo allo scopo di valutare l\'utilizzo del sito Web e compilare report sull\'attivit\\u00E0 del sito Web per gli operatori del sito Web e infine per migliorare il sito. Con l\'adesione, acconsenti al trattamento dei dati analitici nel modo e per gli scopi sopra indicati.\nANONYMOUS_CONSENT_OPT_OUT_TEXT=Questo sito utilizza SAP Web Analytics per analizzare come gli utenti utilizzano il sito. Sulla base del tuo consenso preventivo, nel browser del tuo dispositivo viene reso persistente un cookie per identificare le tue visite ripetute. Queste informazioni vengono utilizzate esclusivamente allo scopo di valutare l\'utilizzo del sito Web e per migliorare ulteriormente il sito. Per rendere anonimo il tracciamento, indica le tue preferenze utilizzando il pulsante "Rendi anonimo" qui di seguito.\nANON_TRK_BUTTON_TEXT=Rendi anonimo\n\nCUSTOM_CONSENT_OPTION=SAP Web Analytics\nTRACKING_ON_STATUS=Attivato/a\nTRACKING_OFF_STATUS=Disattivato/a\nTRACKING_ANON_STATUS=Tracciamento anonimo\nTRACKING_STATUS_TEXT=Stato\\:\n\n',
