	"sap/webanalytics/core/SAPWebAnalyticsFLPPlugin/i18n/i18n_sl.properties":'\nAPP_TITLE=SAP Web Analytics - FLP plug-In\n\nAPP_DESCRIPTION=SAP Web Analytics plug-in za sledenje SAP Fiori Launchpada\n\nCONSENT_OPT_IN_TEXT=Ta stran uporablja re\\u0161itev SAP Web Analytics, s katero analizira, kako uporabniki uporabljajo to stran. Pi\\u0161kotki se uporabljajo za identifikacijo vnovi\\u010Dnih obiskov. \\u010Ce se strinjate, dolo\\u010Dite svoje preference z mo\\u017Enostjo "Dovoli" spodaj. Generirane informacije (vklju\\u010Dno z delom va\\u0161ega IP-naslova in ID-jem brskalnika) bodo poslane SAP-ju, ki jih bo shranil v svojih stre\\u017Enikih. Te informacije bomo uporabljali le za namen vrednotenja uporabe spletne strani in sestavljanje poro\\u010Dil o aktivnosti na spletni strani za operaterje spletne strani ter za izbolj\\u0161avo spletne strani. Va\\u0161a odlo\\u010Ditev je va\\u0161e dovoljenje za obdelavo va\\u0161ih analiti\\u010Dnih podatkov na na\\u010Din in namen, navedena zgoraj.\n\nCONSENT_OPT_OUT_TEXT=Ta stran uporablja re\\u0161itev SAP Web Analytics, s katero analizira, kako uporabniki uporabljajo to stran. Na podlagi va\\u0161ega predhodnega soglasja je v brskalniku va\\u0161e naprave shranjen pi\\u0161kotek za identifikacijo va\\u0161ih vnovi\\u010Dnih obiskov in strani porekla va\\u0161ega obiska. Te informacije se uporabljajo le za namen vrednotenja uporabe spletne strani in za izbolj\\u0161avo spletne strani. \\u010Ce \\u017Eelite preklicati svoje soglasje za sledenje, kliknite spodnji gumb "Prenehaj s sledenjem".\nCONSENT_BUTTON_ALLOW=Dovoli\n\nCONSENT_BUTTON_DENY=Zavrni\n\nCONSENT_BUTTON_STOP_TRACKING=Prenehaj s sledenjem\n\nCONSENT_TOOLTIP_CLOSE=Zapri\n\nPRIVACY_LINK_TEXT=Povezava do informacij o zasebnosti\n\nANONYMOUS_CONSENT_OPT_IN_TEXT=Ta stran uporablja re\\u0161itev SAP Web Analytics, s katero analizira, kako uporabniki uporabljajo to stran. Pi\\u0161kotki se uporabljajo za identifikacijo vnovi\\u010Dnih obiskov. \\u010Ce se strinjate, dolo\\u010Dite svoje preference z mo\\u017Enostjo "Dovoli" spodaj, v nasprotnem primeru se bo anonimizirano sledenje nadaljevalo. Generirane informacije (vklju\\u010Dno z delom va\\u0161ega IP-naslova in ID-jem brskalnika) bodo poslane SAP-ju, ki jih bo shranil v svojih stre\\u017Enikih. Te informacije bomo uporabljali le za namen vrednotenja uporabe spletne strani in sestavljanje poro\\u010Dil o aktivnosti na spletni strani za operaterje spletne strani - ter za izbolj\\u0161avo spletne strani. Va\\u0161a odlo\\u010Ditev je va\\u0161e dovoljenje za obdelavo va\\u0161ih analiti\\u010Dnih podatkov na na\\u010Din in namen, navedena zgoraj.\nANONYMOUS_CONSENT_OPT_OUT_TEXT=Ta stran uporablja re\\u0161itev SAP Web Analytics, s katero analizira, kako uporabniki uporabljajo to stran. Na podlagi va\\u0161ega predhodnega soglasja je v brskalniku va\\u0161e naprave shranjen pi\\u0161kotek za identifikacijo va\\u0161ih vnovi\\u010Dnih obiskov. Te informacije se uporabljajo le za namen vrednotenja uporabe spletne strani in za izbolj\\u0161avo spletne strani. \\u010Ce \\u017Eelite anonimizirati za sledenje, kliknite spodnji gumb "Anonimiziraj".\nANON_TRK_BUTTON_TEXT=Anonimiziraj\n\nCUSTOM_CONSENT_OPTION=SAP Web Analytics\nTRACKING_ON_STATUS=Omogo\\u010Deno\nTRACKING_OFF_STATUS=Onemogo\\u010Deno\nTRACKING_ANON_STATUS=Anonimizirano sledenje\nTRACKING_STATUS_TEXT=Status\\:\n\n',
	"sap/webanalytics/core/SAPWebAnalyticsFLPPlugin/i18n/i18n_sv.properties":'\nAPP_TITLE=SAP Web Analytics - FLP-plug-in\n\nAPP_DESCRIPTION=SAP Web Analytics-plug-in f\\u00F6r sp\\u00E5rning av SAP Fiori-launchpad\n\nCONSENT_OPT_IN_TEXT=Den h\\u00E4r webbplatsen anv\\u00E4nder SAP Web Analytics f\\u00F6r att analysera hur webbplatsen anv\\u00E4nds. Cookies anv\\u00E4nds f\\u00F6r att identifiera upprepade bes\\u00F6k. Om du godk\\u00E4nner dem specificerar du dina preferenser via knappen "Till\\u00E5t" nedan. Informationen som genereras (inklusive en del av din IP-adress och en webbl\\u00E4sar-ID) skickas till SAP och lagras p\\u00E5 SAP\\:s servrar. Denna information anv\\u00E4nds endast f\\u00F6r att utv\\u00E4rdera anv\\u00E4ndningen av webbplatsen, f\\u00F6r att generera rapporter om aktiviteter p\\u00E5 webbplatsen till webbplatsens operat\\u00F6rer, samt f\\u00F6r att f\\u00F6rb\\u00E4ttra webbplatsen. Genom ditt beslut samtycker du till bearbetning av analysdata i den omfattning och f\\u00F6r de syften som anges ovan.\n\nCONSENT_OPT_OUT_TEXT=Den h\\u00E4r webbplatsen anv\\u00E4nder SAP Web Analytics f\\u00F6r att analysera hur anv\\u00E4ndare anv\\u00E4nder webbplatsen. Baserat p\\u00E5 ditt tidigare samtycke har en cookie lagrats i webbl\\u00E4saren p\\u00E5 din enhet f\\u00F6r att identifiera nya bes\\u00F6k och varifr\\u00E5n du g\\u00E5tt till webbplatsen. Denna information anv\\u00E4nds endast f\\u00F6r att utv\\u00E4rdera webbplatsens utnyttjande och f\\u00F6r att f\\u00F6rb\\u00E4ttra webbplatsen. Om du vill \\u00E5terkalla ditt samtycke till sp\\u00E5rning anger du dina preferenser genom att klicka p\\u00E5 "Stoppa sp\\u00E5rning" nedan.\nCONSENT_BUTTON_ALLOW=Till\\u00E5t\n\nCONSENT_BUTTON_DENY=Neka\n\nCONSENT_BUTTON_STOP_TRACKING=Stoppa sp\\u00E5rning\n\nCONSENT_TOOLTIP_CLOSE=St\\u00E4ng\n\nPRIVACY_LINK_TEXT=Sekretessl\\u00E4nk\n\nANONYMOUS_CONSENT_OPT_IN_TEXT=Den h\\u00E4r webbplatsen anv\\u00E4nder SAP Web Analytics f\\u00F6r att analysera hur webbplatsen anv\\u00E4nds. Cookies anv\\u00E4nds f\\u00F6r att identifiera upprepade bes\\u00F6k. Om du godk\\u00E4nner dem specificerar du dina preferenser via knappen "Till\\u00E5t" nedan, annars anv\\u00E4nds anonymiserad sp\\u00E5rning \\u00E4ven i forts\\u00E4ttningen. Informationen som genereras (inklusive en del av din IP-adress och en webbl\\u00E4sar-ID) skickas till SAP och lagras p\\u00E5 SAP\\:s servrar. Denna information anv\\u00E4nds endast f\\u00F6r att utv\\u00E4rdera anv\\u00E4ndningen av webbplatsen, f\\u00F6r att generera rapporter om aktiviteter p\\u00E5 webbplatsen till webbplatsens operat\\u00F6rer, samt f\\u00F6r att f\\u00F6rb\\u00E4ttra webbplatsen. Genom ditt beslut samtycker du till bearbetning av analysdata i den omfattning och f\\u00F6r de syften som anges ovan.\nANONYMOUS_CONSENT_OPT_OUT_TEXT=Den h\\u00E4r webbplatsen anv\\u00E4nder SAP Web Analytics f\\u00F6r att analysera hur anv\\u00E4ndare anv\\u00E4nder webbplatsen. Baserat p\\u00E5 ditt tidigare samtycke har en cookie lagrats i webbl\\u00E4saren p\\u00E5 din enhet f\\u00F6r att identifiera nya bes\\u00F6k. Denna information anv\\u00E4nds endast f\\u00F6r att utv\\u00E4rdera anv\\u00E4ndningen av webbplatsen och f\\u00F6r att f\\u00F6rb\\u00E4ttra webbplatsen. Om du vill anonymisera sp\\u00E5rningen anger du dina preferenser genom att klicka p\\u00E5 "Anonymisera" nedan.\nANON_TRK_BUTTON_TEXT=Anonymisera\n\nCUSTOM_CONSENT_OPTION=SAP Web Analytics\nTRACKING_ON_STATUS=Aktiverad\nTRACKING_OFF_STATUS=Inaktiverad\nTRACKING_ANON_STATUS=Anonym sp\\u00E5rning\nTRACKING_STATUS_TEXT=Status\\:\n\n',
